import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './components/App.js';

ReactDOM.render(
    <BrowserRouter>
        <Routes>
            <Route path="/" element={<Layout />}>
                <Route index element={<Home />} />
            </Route>
        </Routes>
    </BrowserRouter>
)
